DROP TABLE IF EXISTS users, comments, posts;

create table users (
	user_id INT,
	username VARCHAR(50),
	password VARCHAR(50),
	firstname VARCHAR(50),
	lastname VARCHAR(50),
	created_at TIMESTAMPTZ,
	updated_at TIMESTAMPTZ,
	last_logged_in TIMESTAMPTZ
);

create table posts (
	post_id INT,
	user_id INT,
	title VARCHAR(50),
	content TEXT,
	status VARCHAR(9),
	likes INT DEFAULT 0,
	created_at TIMESTAMPTZ,
	updated_at TIMESTAMPTZ,
	published_at TIMESTAMPTZ
);

create table comments (
	comment_id INT,
	post_id INT,
	user_id INT,
	comment TEXT,
	created_at TIMESTAMPTZ,
	updated_at TIMESTAMPTZ
);



